import './App.css';
import BrowserApp from './BrowserApp.js'

class App extends Component {
  render() {
    return (
			<React.Fragment>
        <BrowserView>
          <BrowserApp />
        </BrowserView>
        <MobileView>
          <iframe src="https://onlineorders.wawio.com/menu/58b094014f5ee90b787b23ce"></iframe>
        </MobileView>
			</React.Fragment>
    );
  }
}

export default App;
